import React from 'react';
import AdminSidebar from "../components/AdminSideBar";
import AdminFooter from "../components/AdminFooter";


function Home() {
  return (
    <div className="flex flex-row  gap-0">
        <div className="flex flex-col gap-0 items-center">
        <AdminSidebar/>
        Home
        </div>
        <AdminFooter/>
    </div>
  )
}

export default Home
